import React, { useState } from "react";
import { createTrade } from "../api/TradesAPI";

const NewTrade = () => {
  const [formData, setFormData] = useState({
    symbol: "",
    option_type: "CALL",
    strike_price: "",
    exp_date: "",
    entry_price: "",
    exit_price: "",
    contracts: "",
    entry_date: "",
    close_date: "",
    user_id: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await createTrade(
        {
          ...formData,
          strike_price: parseFloat(formData.strike_price),
          entry_price: parseFloat(formData.entry_price),
          exit_price: formData.exit_price
            ? parseFloat(formData.exit_price)
            : null,
          contracts: parseInt(formData.contracts),
        },
        parseInt(formData.user_id)
      );

      console.log("Success:", response);
      alert("Trade submitted successfully");
    } catch (error) {
      console.error("Error:", error);
      alert("Error submitting trade");
    }
  };

  return (
    <div className="new-trade-container">
      <div className="header-card">
        <p className="title">New</p>
      </div>
      <hr />{" "}
      <form onSubmit={handleSubmit} className="form-container">
        <label>
          <input
            type="text"
            placeholder="Symbol"
            name="symbol"
            value={formData.symbol}
            onChange={handleChange}
            required
          />
        </label>
        <br />
        <label>
          Option Type:
          <select
            name="option_type"
            value={formData.option_type}
            onChange={handleChange}
            required
          >
            <option value="CALL">CALL</option>
            <option value="PUT">PUT</option>
          </select>
        </label>
        <br />
        <label>
          Strike Price:
          <input
            type="number"
            name="strike_price"
            value={formData.strike_price}
            onChange={handleChange}
            required
          />
        </label>
        <br />
        <label>
          Expiration Date:
          <input
            type="date"
            name="exp_date"
            value={formData.exp_date}
            onChange={handleChange}
            required
          />
        </label>
        <br />
        <label>
          Entry Price:
          <input
            type="number"
            step="0.01"
            name="entry_price"
            value={formData.entry_price}
            onChange={handleChange}
            required
          />
        </label>
        <br />
        <label>
          Exit Price:
          <input
            type="number"
            step="0.01"
            name="exit_price"
            value={formData.exit_price}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          Contracts:
          <input
            type="number"
            name="contracts"
            value={formData.contracts}
            onChange={handleChange}
            required
          />
        </label>
        <br />
        <label>
          Entry Date:
          <input
            type="date"
            name="entry_date"
            value={formData.entry_date}
            onChange={handleChange}
            required
          />
        </label>
        <br />
        <label>
          Close Date:
          <input
            type="date"
            name="close_date"
            value={formData.close_date}
            onChange={handleChange}
          />
        </label>
        <br />
        <label>
          User ID:
          <input
            type="number"
            name="user_id"
            value={formData.user_id}
            onChange={handleChange}
            required
          />
        </label>
        <br />
        <button type="submit">Submit Trade</button>
      </form>
    </div>
  );
};

export default NewTrade;
